function scrollActiveListItemIntoView() {
    // Get the active sidebar list item with the "active" class
    var activeListItem = $('ul.sidebar-links li.sidebar-list.active')[0];
    
    // Check if the active list item exists
    if (activeListItem) {
        // Scroll the active list item into view
        activeListItem.scrollIntoView({
            behavior: 'smooth', // Use smooth scrolling behavior
            block: 'start' // Scroll to the start of the list item
        });

        // Once scrolled into view, hide the loader
        $('#client_loader').hide();
    }
}

// Call the function when the document is ready
$(document).ready(function() {
    // Show loader while waiting for page load
    $('#client_loader').show();

